import React from 'react';
import '../../App.css';
import './ProjectCard.css';
import { makeTags, formatText } from '../data/Data.js'

// import trim from '../pages/aboutMedia/trim.jpg'
import thirty_day_adulting from './media/ThirtyDayCard.png'
import twentyfour from './media/24Card.png'
import sentence_mosaics from './media/SentenceMosaicsCard.png'
import dfa_website from './media/DFAWebsiteCard.png'
import duquesne_incline from './media/DuquesneWebsiteCard.png'
import microsite from './media/DuquesneWebsiteCard.png'


function ProjectCard(props) {
    return (
        <>
            <div className="project-card-container">
                {cardImg(props.component)}
                <div className="card-text">
                    <div className="featured-tags">{ makeTags(props.tags) }</div>
                    <h3>{ props.title }</h3>
                </div>
            </div>
        </>
    );
}

function cardImg(id) {
    switch (id) {
        case "thirty_day_adulting":
            return  <img src={thirty_day_adulting} className="about-media" alt="#{id} card"></img>;
        case "twentyfour":
            return  <img src={twentyfour} className="about-media-contain" alt="#{id} card"></img>;
        case "sentence_mosaics":
            return  <img src={sentence_mosaics} className="about-media-contain" alt="#{id} card"></img>;
        case "dfa_website":
            return  <img src={dfa_website} className="about-media-top" alt="#{id} card"></img>;
        case "duquesne_incline":
            return  <img src={duquesne_incline} className="about-media-top" alt="#{id} card"></img>;

    // <img src={id} className="about-media" alt="#{id} card image"></img>
    }
} 

export default ProjectCard;
